"""### Buat Fungsi untuk Binary Encoding"""

def bin_encode(data, bit_length):
  #ubah desimal ke biner
  #jika bit_length lebih besar dari panjang biner data maka,
  #tambahkan 0 sebanyak selisih bit_length - len(biner data)
  binary_encoded_data = bin(data)[2:]
  if bit_length > len(binary_encoded_data):
    binary_encoded_data = '0'*(bit_length - len(binary_encoded_data)) + binary_encoded_data
  return binary_encoded_data

"""### Buat Program Encoding untuk Golomb Coding

Langkah-langkah Golomb Coding:

Misal parameter Golomb = $M$

Hitung:

1. $q=⌊n/M⌋$


2. $r=n-qM$ atau $n$ $mod$ $M$


3. Representasikan quotient $q$ dalam unary code

4. Tentukan panjang bit remainder:

      $c=⌈\log_{2}M⌉$

      dan nilai batas:

      $2^{c}−M$

5. Jika remainder $r<2^{c}−M$
→ Gunakan c−1 bit binary untuk r


   Jika remainder $r≥2^{c}−M$: → Gunakan c bit binary untuk $r+2^{c}−M$.

6. Gabungkan kode unary (quotient) + binary (remainder).
"""

import math
n= [42, 10, 4, 7, 100, 1, 3, 1]    #data
M = 10                              #M-nya bebas

kode_output = []
detail = []
bitstream=''
for data in n:
  #hitung q
  q= data //M
  #hitung r
  r= data % M
  #lakukan unary code untuk q -> unary_encode(q)
  u = unary_encode(q)
  #hitung c
  c= math.ceil(math.log(M, 2))
  #hitung nilai batas
  batas = (2**c) - M
  #jika r < nilai batas -> maka encode r sebanyak c-1 bit bin_encode (r,c-1)
  if r < batas:
    r_encoded = bin_encode(r, c-1)
  #jika r >= nilai batas -> maka r baru menjadi r+2^c dan di encode sepanjang c bit -> bin_encode(r+2^c,c)
  else:
    r_encoded = bin_encode(r+2**c, c)
  #gabungkan u dan r_encoded
  #maka golomb_code = hasil unary_encode + hasil bin_encode
  golomb_code = u + r_encoded

  #masukkan ke output
  kode_output.append(golomb_code)
  bitstream += golomb_code
  detail.append({
      "n": data, "q": q, "r":r, "c":c, "batas":batas, "unary(q)": u, "kode_r": r_encoded, "kode_golomb": golomb_code
  })

print("data:",n)

# cetak hasil enncode
print("\nHasil Encode:",kode_output)
print("Gabungan    :", bitstream)

